INSERT INTO `zhidao_info` VALUES (3, '云南农业大学普洱校区介绍', '<p>云南农业大学普洱校区坐落在“世界茶源”、“中国咖啡之都”的普洱市，是依托热区、面向全国、辐射东南亚，主要培养热区现代特色农业、康养旅游、民族文化传承与创新等应用型人才的特色学院。校区现占地1372亩，有教职工270余人，其中在职在编教师161人，其中高级职称49人，硕士及以上学历101人，硕士生导师6人、省级教学名师3人、云南现代农业产业体系岗位专家1人、云南高原特色产业促进会专家团顾问2人。普洱校区结合云南热带生态农业研究院建设还将引进10名院士、100名博士、100名教授。</p><p> </p><p> 普洱校区目前设有一个学院—热带作物学院，本部有近20个学院50余个专业的学生常年到普洱校区进行学习、交流。热带作物学院有农学（热带作物方向）、中草药栽培与鉴定、电子商务、网络工程、秘书学等13个应用本科专业和茶艺与茶叶营销、食品检测技术、工程造价、会计、国际经济与贸易、计算机网络技术等16个专升本专业和21个专科专业；有全日制学生9800余人，其中热作学院学生6500余人，大类学生3293人，另有函授生和远程教育学生1200人。学院注重毕业生就业创业能力培养，通过开展职业技能训练、创业体验与实践、升学辅导与培训、引进知名企业等工作，不断提升学生的就业创业竞争能力。近三年来，学生获得省级技能大赛奖40项，创业创新项目立项162项，毕业生年终就业率平均达96.7%以上，就业质量稳步提高。</p><p> </p><p> 普洱校区——热带作物学院始终坚持服务热区经济社会发展和区域产业经济建设，建设高水平应用型学院的办学定位，励精图治，人才培养质量不断提高，为学生成长成才和地方经济社会建设以及产业发展做出了积极贡献，赢得了社会各界的广泛赞誉，被誉为“云南热区人才的摇篮”。</p><p>&nbsp;</p><p>&nbsp;</p><p>地址：洗马湖校区&nbsp;&nbsp;&nbsp;云南省普洱市思茅区思亭路3号&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;邮编：665099&nbsp;</p><p> </p><p> 倚象校区&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;云南省普洱市思茅区倚象镇帝泊洱大道中段&nbsp;&nbsp;&nbsp;&nbsp;邮编：665099</p><p> </p><p> 学院党政办公室电话：0879-2206624&nbsp;&nbsp;&nbsp;&nbsp;招生电话：0879-2201617&nbsp;&nbsp;&nbsp;就业电话：0879-2202358&nbsp;&nbsp;0879-3028687</p>');

